[DISURUH si BOBBY dan HARUS DENGAN KATA KATA MANIS]

Saya sangat bersyukur kepada Tuhan karena memiliki kesempatan bisa mengenal kalian sedikit banyak. Terimakasih sudah menaruh kasih dan perhatian kepadaku melalui bentuk perayaan ulang tahun ini.
Semoga di masa mendatang kita tidak lupa momen kerbersamaan seperti ini.
Mohon maaf jika aku tidak melakukan hal yang sama pada saat kalian berulang tahun; ya kalian mengenalku lah ya hehe.

selain lagu selamat ulang tahun, berikut ini juga ada lagu untuk kita (jangan hakimi kalau tidak sesuai konteks ya haha): Kidung Jemaat 393 - Tuhan, Betapa Banyaknya (ayat 2)

Sanak saudara dan teman Kaub'ri kepadaku;

berkat terindah ialah 'ku jadi anakMu.

T'rima kasih, ya Tuhanku atas keselamatanku!

Padaku telah Kauberi hidup bahagia abadi.

